import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../CheckInfo.css";
import "../fonts/fonts.css";

function CheckInfo() {
  const navigate = useNavigate();

  // 선택된 정보 저장
  const [getInfo, setGetInfo] = useState("");

  const [isOClicked, setIsOClicked] = useState(false);
  const [isXClicked, setIsXClicked] = useState(false);

  const handleOClick = () => {
    setIsOClicked(true);
    setIsXClicked(false);
  };

  const handleXClick = () => {
    setIsOClicked(false);
    setIsXClicked(true);
  };

  return (
    <div className="CheckInfo">
      <div id="title">
        <h2>예정된 여행에 대한 정보를 선택해주세요.</h2>
      </div>
      <div className="Q">
        <text>1. 여행일자를 선택해주세요.</text>
        <button id="day">날짜 선택 🗓️</button>
      </div>
      <div className="Q">
        <text>2. 여행 시작과 종료 시간을 선택해주세요.</text>
        <div className="CheckTime">
          <text>시작</text>
          <select>
            <option value={"아침(8-9시)"}>아침 (8-9시)</option>
            <option value={"점심(12-13시)"}>점심 (12-13시)</option>
            <option value={"오후(14-15시)"}>오후 (14-15시)</option>
          </select>
          <text>|</text>
          <text>종료</text>
          <select>
            <option value={"18-19시"}>18-19시</option>
            <option value={"17-21시"}>17-21시</option>
            <option value={"21-22시"}>21-22시</option>
          </select>
        </div>
        <div className="Q">
          <text>3. 이동수단으로 차를 이용하실 건가요?</text>
          <span>
            <button
              className={`car ${isOClicked ? "clicked" : ""}`}
              onClick={handleOClick}
            >
              O
            </button>
            <button
              className={`car ${isXClicked ? "clicked" : ""}`}
              onClick={handleXClick}
            >
              X
            </button>
          </span>
          <div className="Q">
            <text>4. 여행 테마를 선택해주세요. (최대 3개 선택 가능)</text>
            <span>
              <button className="theme"></button>
              <button className="theme"></button>
              <button className="theme"></button>
            </span>
            <span>
              <button className="theme"></button>
              <button className="theme"></button>
              <button className="theme"></button>
            </span>
          </div>
          <div className="Q">
            <text>5. 선호하는 여행 지역을 선택해주세요. (필수 X)</text>
            <span>
              <button className="location">동 부</button>
              <button className="location">서 부</button>
            </span>
          </div>
          <div className="Q">
            <text>6. 동행자 유형을 선택해주세요. (필수 X)</text>
            <span>
              <button className="with">부모님</button>
              <button className="with">아이</button>
              <button className="with">연인</button>
              <button className="with">친구</button>
            </span>
          </div>
          <div>
            <button
              id="result"
              onClick={() => {
                navigate("options");
              }}
            >
              경로 추천 받기
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CheckInfo;
